INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Downs Syndrome', 144481, 114, 'da3ef7cb-7b03-4bb3-8c8d-858629a80f5c', null, 'Q90.9', null, 41040004, null, null, '2021-06-09 16:10:25.982661', 0, 'A chromosome disorder associated either with an extra chromosome 21 or an effective trisomy for chromosome 21. Clinical manifestations include hypotonia; short stature; brachycephaly; upslanting palpebral fissures; epicanthus; Brushfield spots on the iris; protruding tongue; small ears; short; broad hands; fifth finger clinodactyly; Simian crease; and moderate to severe MENTAL RETARDATION. Cardiac and gastrointestinal malformations; a marked increase in the incidence of LEUKEMIA; and the early onset of ALZHEIMER DISEASE are also associated with this condition. Pathologic features include the development of NEUROFIBRILLARY TANGLES in neurons and the deposition of AMYLOID BETA-PROTEIN; similar to the pathology of ALZHEIMER DISEASE. (Menkes; Textbook of Child Neurology; 5th ed; p213)', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'Chromosomal Abnormalities (E.G Downs Syndrome; Edwards Syndrome Etc.)', 'Chromosomal Abnormalities (E.G Downs Syndrome; Edwards Syndrome Etc.)');
