INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Lymphogranuloma venereum', 135462, 232, '7f268952-2765-4785-bb2f-506957db98e7', 'Diagnosis', 'A55', null, 186946009, null, null, '2021-06-09 16:10:25.982661', 0, 'Subacute inflammation of the inguinal lymph glands caused by certain immunotypes of CHLAMYDIA TRACHOMATIS. It is a sexually transmitted disease in the U.S. but is more widespread in developing countries. It is distinguished from granuloma venereum (see GRANULOMA INGUINALE); which is caused by Calymmatobacterium granulomatis.', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'Sexually Transmitted Infections', 'Sexually Transmitted Infections');
