INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Malaria', 116128, 234, '93ec041f-8fca-4d65-900d-1da9f31c77b3', 'Diagnosis', 'B54', 'Clinical Malaria; Mal; partially treated malaria', 61462000, null, null, '2021-06-09 16:10:25.982661', 0, 'A protozoan disease caused by four species of the genus PLASMODIUM (P. falciparum (MALARIA; FALCIPARUM); P. vivax (MALARIA; VIVAX); P. ovale; and P. malariae) and transmitted by the bite of an infected female mosquito of the genus Anopheles. Malaria is endemic in parts of Asia; Africa; Central and South America; Oceania; and certain Caribbean islands. It is characterized by extreme exhaustion associated with paroxysms of high fever; sweating; shaking chills; and anemia.', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'Suspected Malaria', 'Suspected Malaria');
INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Malaria; cerebral', 145851, 235, '4452ac39-8e69-4b34-a6df-22c574c794fb', null, 'B50.0', null, 53622003, null, null, '2021-06-09 16:10:25.982661', 0, 'A condition characterized by somnolence or coma in the presence of an acute infection with PLASMODIUM FALCIPARUM (and rarely other Plasmodium species). Initial clinical manifestations include HEADACHES, SEIZURES, and alterations of mentation followed by a rapid progression to COMA. Pathologic features include cerebral capillaries filled with parasitized erythrocytes and multiple small foci of cortical and subcortical necrosis. (From Adams et al., Principles of Neurology, 6th ed, p136)', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'Other Central Nervous System Conditions', 'Other Central Nervous System Conditions');
