INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Measles', 134561, 242, '9591e121-1a19-4fb2-af65-c4c5c7baee13', 'Diagnosis', 'B05.9', null, 14189004, null, null, '2021-06-09 16:10:25.982661', 0, 'A highly contagious infectious disease caused by MORBILLIVIRUS; common among children but also seen in the nonimmune of any age; in which the virus enters the respiratory tract via droplet nuclei and multiplies in the epithelial cells; spreading throughout the reticuloendothelial system. (From Dorland; 27th ed)', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'Measles', 'Measles');
INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Meningitis', 115835, 243, '23c6d752-53b7-44a6-be29-d1b1cd1938b7', 'Diagnosis', 'G03.9', null, 7180009, null, null, '2021-06-09 16:10:25.982661', 0, 'Inflammation of the coverings of the brain and/or spinal cord; which consist of the PIA MATER; ARACHNOID; and DURA MATER. Infections (viral; bacterial; and fungal) are the most common causes of this condition; but subarachnoid hemorrhage (HEMORRHAGES; SUBARACHNOID); chemical irritation (chemical MENINGITIS); granulomatous conditions; neoplastic conditions (e.g.; carcinomatous meningitis); and other inflammatory conditions may produce this syndrome. (From Joynt; Clinical Neurology; 1994; Ch24; p6)', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'Other Meningitis', 'Other Meningitis');
INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Meningococcal Meningitis', 134369, 244, 'b77a1922-c984-42ca-ab0f-609ef6a3c407', null, 'A39.0', null, 192644005, null, null, '2021-06-09 16:10:25.982661', 0, 'A fulminant infection of the meninges and subarachnoid fluid by the bacterium NEISSERIA MENINGITIDIS; producing diffuse inflammation and peri-meningeal venous thromboses. Clinical manifestations include FEVER; nuchal rigidity; SEIZURES; severe HEADACHE; petechial rash; stupor; focal neurologic deficits; HYDROCEPHALUS; and COMA. The organism is usually transmitted via nasopharyngeal secretions and is a leading cause of meningitis in children and young adults. Neisseria meningitidis serogroups A; B; and C have been reported to cause meningitis. (From Adams et al.; Principles of Neurology; 6th ed; pp689-701; Curr Opin Pediatr 1998 Feb;10(1):13-8)', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'Meningococcal Meningitis', 'Meningococcal Meningitis');
INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Menorrhagia', 134345, 245, 'e9509e69-41ae-4706-b0a0-e56415aa8114', null, 'N92.0', null, 386692008, null, null, '2021-06-09 16:10:25.982661', 0, 'Excessive menstrual flow.', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'NA', 'All Other Diseases');
INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Mental Disorder', 134337, 246, 'c441a672-9e90-4168-9f32-c1773fb571a2', 'Diagnosis', 'F99', 'Psychological problem', 74732009, 413307004, null, '2021-06-09 16:10:25.982661', 0, 'Psychiatric illness or diseases manifested by breakdowns in the adaptational process expressed primarily as abnormalities of thought; feeling; and behavior producing either distress or impairment of function.', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'Mental Disorders', 'Mental Disorders');
INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Mental or behavioral disorder due to alcohol or illicit drug use', 160200, 247, 'e5cf4add-690a-4290-983b-94f574d3e484', 'Diagnosis', 'F19.9', null, null, 87858002, null, '2021-06-09 16:10:25.982661', 0, 'Category of diagnoses.', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'All Other Diseases', 'All Other Diseases');
INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Mental Retardation', 115809, 248, 'f40e1722-8895-4e70-a337-12b7100d1a5b', null, 'F79.9', null, 91138005, null, null, '2021-06-09 16:10:25.982661', 0, 'Subnormal intellectual functioning which originates during the developmental period. This has multiple potential etiologies; including genetic defects and perinatal insults. Intelligence quotient (IQ) scores are commonly used to determine whether an individual is mentally retarded. IQ scores between 70 and 79 are in the borderline mentally retarded range. Scores below 67 are in the retarded range. (Joynt; Clinical Neurology; 1992; Ch55; p28)', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'Mental Disorders', 'Mental Disorders');
INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Microcephalus', 134213, 249, '829e3fbd-9670-4115-8dc3-e16160a0754e', 'Diagnosis', 'Q02', null, 1829003, null, null, '2021-06-09 16:10:25.982661', 0, 'Abnormal smallness of the head; usually associated with mental retardation. (Dorland; 27th ed)', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'Congenital Anomalies', 'Congenital Anomalies');
INSERT INTO adempiere.bh_coded_diagnosis (ad_client_id, ad_org_id, bh_ceilname, bh_ciel_id, bh_coded_diagnosis_id, bh_coded_diagnosis_uu, bh_concept_class, bh_icd10who, bh_searchterms, bh_synomed_ct, bh_synomed_np, bh_synonyms, created, createdby, description, isactive, updated, updatedby, bh_shortnames, bh_moh705a_lessthan5, bh_moh705b_greaterthan5) VALUES (0, 0, 'Migraine Headache', 115779, 250, '08f333df-9b0c-44ea-a88c-20db8111edd4', null, 'G43.9', null, 37796009, null, null, '2021-06-09 16:10:25.982661', 0, 'A subtype of vascular headaches characterized by periodic unilateral pulsatile headaches which begin in childhood, adolescence, or early adult life and recur with diminishing frequency during advancing years. The two major subtypes are CLASSIC MIGRAINE (i.e., migraine with aura) and COMMON MIGRAINE (i.e., migraine without aura). Migrainous episodes may be associated with alterations in cerebral blood flow. (From Adams et al., Principles of Neurology, 6th ed, p172)', 'Y', '2021-06-09 16:10:25.982661', 0, null, 'Other Central Nervous System Conditions', 'Other Central Nervous System Conditions');
